import Game from './Game.js';
import Lobby from './Lobby';
import { Route, Switch } from 'react-router-dom';

export default class App extends Component {
	render() {
		return (
		<Container>
		<Header />
		<div id="content">
		Gameplay
		  </div>

		<Footer />
		</Container>
		)
	}
}
